export const add=(task)=>{
    return {
        type:'ADD',
        payload:task
    }
}

export const done=()=>{
    return {
        type: 'DONE'
    }
}

export const edit=(payload)=>{
    return {
        type: 'EDIT',
        payload
    }
}

export const delett=(payload)=>{
    return {
        type: 'DELETE',
        payload
    }
}
